            </div>
          </div>

          {/* „Çπ„Ç≠„É´„ÉªËààÂë≥„Çª„ÇØ„Ç∑„Éß„É≥ */}
          <div className="skills-interests-section">
            <div className="skills-section">
              <h3 className="section-title">„Çπ„Ç≠„É´„ÉªÂ∞ÇÈñÄÂàÜÈáé</h3>
              <div className="tags">
                {profile.skills.map((skill, index) => (
                  <span key={index} className="tag skill-tag">
                    {skill}
                  </span>
                ))}
              </div>
            </div>

            <div className="interests-section">
              <h3 className="section-title">Ë∂£Âë≥„ÉªËààÂë≥</h3>
              <div className="tags">
                {profile.interests.map((interest, index) => (
                  <span key={index} className="tag interest-tag">
                    {interest}
                  </span>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MyPage;
